import React from "react";

const Weather = (props) => {

		return(

			<div className = "weather__info"> 

			{

			 props.city && props.country && <p className = "weather__key"> The temperature in {props.city}, {props.country} is 
			 	
			 	<span> {props.temperature}</span>

			 </p>

			}

			{
			 props.humidty && <p className = "weather__key"> The humidity is  
			 	
			 	<span> {props.humidity}</span>

			 </p>

			}

			{
			 props.description && props.wind && <p className = "weather__key"> You can expect {props.description} and wind speeds of
			 	
			 	<span> {props.wind}</span>

			 </p>

			}

			{

			 props.error && <p> {props.error}

			 </p>

			}

			</div>

		);

};

export default Weather;
